<script>
import VizSection from '@/components/VizSection';
import * as d3Base from "d3";
export default {
    name: "Test",
    components:{
        VizSection
    },
    data() {
            return {
              publicPath: process.env.BASE_URL,
              d3: null,

              sntl_variable: "Value_inches", // starting variable to map site colors
              sntl_data: [], // sntl data

              sntl_map: null, //  the svg
              sntl_sites: null, // g for sites in svg

            // variables of interest for map
              site_vars: {
                swe: "Value_inches", 
                POR_Median: 'POR_Median_inches', 
                POR_Average: 'POR_Average_inches', 
                POR_diff: 'POR_Median_Departure_inches',
                POR_Median_percent: 'Percent_of_POR_Median', 
                POR_Peak_percent:'Percent_of_Median_Water_Year_Peak_POR',
                Peak_percent:'Percent_of_Water_Year_Peak',
                },

              // chart opts
              xScale: null,
              yScale: null,
              site_radius: 3,
              colorValueInches: null,
            }
        },
    mounted() {
          const self = this;
          this.d3 = Object.assign(d3Base);

          // sntl site map
          this.sntl_map = this.d3.select("svg#usa-sntl");

          //  read in data and bind with svg sites
          this.loadData();
          console.log(this.sntl_variable)

        },
    methods: {
      loadData() {
        const self = this;
        // read in data 
        let promises = [self.d3.csv(self.publicPath + "data/sntl_data.csv", this.d3.autoType)];

        Promise.all(promises).then(self.callback); 
      },
      callback(data) {
        const self  = this;
        this.sntl_data = data[0];// has a key variable and x and y positioning

        this.sntl_sites = this.sntl_map.append("g").classed("sites", true)
        this.site_vars.setColor = this.sntl_variable; // set chart color to selected color
        
        // draw sites on map
        this.addSites();
      },
      addSites() {
        const self = this;

        // axis scales
        this.xScale = this.d3.scaleLinear()
          .range([0,  700])
          .domain([0, 700]);

          this.yScale = this.d3.scaleLinear()
          .range([840,  0])
          .domain([840, 0]);

        this.sntl_sites.selectAll("SNTL")
        .data(this.sntl_data) // the key for each  site for updating data
        .enter()
        .append("circle")
          .attr("cx", function (d) { return self.xScale(d.x); })
          .attr("cy", function (d) { return self.yScale(d.y); } )
          .classed("SNTL",  true)
          .attr("opacity", .8)
          .attr("r", this.site_radius);

        self.setColor(); // set initial site color
      },
      setColor() {
        const self = this;
        console.log(this.sntl_variable);

        this.site_vars.setColor = this.sntl_variable; // set chart color to selected color

        // color scales
        this.colorValueInches = this.d3.scaleSequential()
          .domain(this.d3.extent(this.sntl_data, function(d) { return +d[self.site_vars.setColor]}))
          .interpolator(this.d3.interpolateBrBG)

       // initially draw with 2021 snow/swe levels
       this.sntl_sites.selectAll("circle.SNTL")
          .attr("fill", function(d) { return self.colorValueInches(d[self.site_vars.setColor]) })
          //.attr("stroke","lightgrey")
      }
  }
}
</script>
